import React, { useState } from "react";
import Box, { SharedBoxProps, v } from "../base/Box";
import { useConfig } from "../hooks/configHooks";
import { CssSize } from "../types";
import { mergeProps } from "../utils/deepMerge";
import parseSize from "../utils/parseSize";

export type IconName = keyof typeof icons;

export type IconProps = SharedBoxProps & {
  name: IconName;
  onClick?: (event: React.MouseEvent<HTMLElement>) => void;
  onKeyDown?: (event: React.KeyboardEvent<HTMLElement>) => void;
  size?: CssSize;
  rotate?: number;
  offset?: CssSize;
  end?: "butt" | "round" | "square" | "inherit";
  join?: "miter" | "round" | "bevel" | "inherit";
  strokeWidth?: CssSize;
  color?: string;
  hoverColor?: string;
  currentColor?: string;
  style?: React.CSSProperties;
};

export const Icon = (props: IconProps) => {
  const config = useConfig();

  const {
    name,
    size,
    rotate,
    offset,
    end,
    join,
    strokeWidth,
    color: providedColor,
    hoverColor: providedHoverColor,
    currentColor,
    strokeInButtons,
    sizeInButtons,
    onClick,
    onKeyDown,
    style: providedStyle,
    ...otherProps
  } = mergeProps(config.Icon, props);

  const [isHover, setIsHover] = useState(false);

  const parsedSize = parseSize(size);

  const color = v(providedColor, config);
  const hoverColor = v(providedHoverColor, config);

  const iconColor = isHover && hoverColor ? hoverColor : currentColor ? "currentColor" : color;

  const IconComponent = getIconComponent(name);

  const style = {
    position: "relative",
    bottom: offset,
    cursor: onClick ? "pointer" : undefined,
    flex: "0 0 auto",
    ...(rotate
      ? {
          transform: "rotate(" + rotate + "deg)",
        }
      : {}),
    ...providedStyle,
  };

  if (IconComponent) {
    return (
      <IconComponent
        onMouseEnter={() => setIsHover(true)}
        onMouseLeave={() => setIsHover(false)}
        width={parsedSize}
        height={parsedSize}
        stroke={iconColor}
        fillColor={iconColor}
        strokeWidth={strokeWidth}
        strokeLinecap={end}
        strokeLinejoin={join}
        style={style}
        onClick={onClick}
        onKeyDown={onKeyDown}
        {...otherProps}
      />
    );
  } else {
    return null;
  }
};

export function getAllIconNames() {
  return Object.keys(icons).sort();
}

function getIconComponent(name: IconName) {
  if (icons[name]) {
    return icons[name];
  } else {
    console.error(`No icon named "${name}"`);
    return null;
  }
}

function sanitizeProps(p: any) {
  const props = { ...p };
  delete props.fillColor;
  return props;
}

